	private static final Pattern IMAGE_PATTERN = Pattern.compile("<img[^>]+src\s*=\s*['\"]([^'\"]+)['\"][^>]*>");	
	private static final Pattern IMAGE_SRC_PATTERN = Pattern.compile("src\s*=\s*['\"]([^'\"]+)['\"][^>]");
	
	private static final Pattern P_PATTERN = Pattern.compile("<p[^>]+style\s*=\s*['\"]([^'\"]+)['\"][^>]*>");

	@Test
	void validarPatter() {
	    String templatePdf = "<table style='width:355px;margin-left:0'><tr><th style='width:240px;text-align:right'><p style='margin-left:60px;text-align:right'><span style='font-weight:700;font-family:Montserrat;font-size:10.5px;text-align:right'>{{primerBloque}}</span><br><span style='font-weight:400;font-family:Montserrat;font-size:10.5px;text-align:right'>{{segundoBloque}}</span><br><span style='font-weight:400;font-family:Montserrat;font-size:9px;text-align:right'>{{tercerBloque}}</span></p></table>";
	    
	    /*String html="<html style='padding-top:15px;margin-top:15px;height:10px;'><body style='height:10px;padding-top:15px;margin-top:15px;'><table style='padding-top:100px;margin-top:100px;margin-left:-36px;padding-bottom:0px;padding-top:0px;height:10px;width:644px'><tr><th><p style='margin:0;text-align: left;color:#B7893F;font-weight: normal;font-family:Montserrat;font-size:8px;'>Av. Hidalgo 77, Módulo VII, Piso 6; Col. Guerrero; Cuauhtémoc; 06300; Ciudad de México </br> sat.gob.mx / MarcaSAT 55 6272 2728</p>"
		+ " <img style='margin:0;' src='data:image/png;base64,' alt='Red dot' /></th><th>"
		+ " <img style='margin-left:-35px;position:relative;' src='data:image/png;base64,' alt='Red dot' /></th></tr></table></body></html>";
		String str = StringUtils.replace(html, "<br>", "<br/>");
		String str2 = str;*/
	    
	    String html = templatePdf;
	    String str = StringUtils.replace(html, "<br>", "<br/>");
	    String str2 = str;

	    Matcher m = IMAGE_PATTERN.matcher(str);
	    int contadorImagePattern = 0;
	    while (m.find()) {
	        contadorImagePattern++;
	        Matcher m1 = IMAGE_SRC_PATTERN.matcher(m.group(0));
	        int contadorImageSrcPattern = 0;
	        while (m1.find()) {
	            contadorImageSrcPattern++;
	            assertTrue(m1.group(0).length() > 0, "La fuente de la imagen no debe estar vacía");
	        }
	        assertTrue(contadorImageSrcPattern > 0, "IMAGE_SRC_PATTERN debería encontrar coincidencias dentro de las coincidencias de IMAGE_PATTERN");
	    }
	    assertTrue(contadorImagePattern > 0, "IMAGE_PATTERN debería encontrar coincidencias");

	    Matcher m1 = P_PATTERN.matcher(str);
	    int contadorPPattern = 0;
	    while (m1.find()) {
	        contadorPPattern++;
	        assertNotNull(m1.group(0), "La coincidencia de P_PATTERN no debe ser nula");
	    }
	    assertTrue(contadorPPattern > 0, "P_PATTERN debería encontrar coincidencias en la cadena");
	}

